import{_ as a,o as t,c as s,z as e,a as n}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 3.2-4758 Grain Dealers Licensing and Bonding Fund established; disposition of fees and penalties.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/3.2-4758.md","filePath":"vacode/3.2-4758.md"}'),i={name:"vacode/3.2-4758.md"},o=e("h1",{id:"§-3-2-4758-grain-dealers-licensing-and-bonding-fund-established-disposition-of-fees-and-penalties",tabindex:"-1"},[n("§ 3.2-4758 Grain Dealers Licensing and Bonding Fund established; disposition of fees and penalties. "),e("a",{class:"header-anchor",href:"#§-3-2-4758-grain-dealers-licensing-and-bonding-fund-established-disposition-of-fees-and-penalties","aria-label":'Permalink to "§ 3.2-4758 Grain Dealers Licensing and Bonding Fund established; disposition of fees and penalties."'},"​")],-1),d=e("p",null,'There is hereby created in the state treasury a special nonreverting fund to be known as the Grain Dealers Licensing and Bonding Fund, hereafter referred to as "the Fund." The Fund shall be established on the books of the Comptroller. All fees and penalties for renewals payable under this article shall be collected by the Commissioner and paid into the state treasury and credited to the Fund. Interest earned on moneys in the Fund shall remain in the Fund and be credited to it. Any moneys remaining in the Fund, including interest thereon, at the end of each fiscal year shall not revert to the general fund but shall remain in the Fund. Moneys in the Fund shall be used for the sole purpose of enforcement of this article.',-1),r=e("p",null,[n("1972, c. 296, § 3.1-722.22; 1975, c. 531; 1982, c. 187; 2008, c. "),e("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0860",target:"_blank",rel:"noreferrer"},"860"),n(".")],-1),l=[o,d,r];function h(c,f,p,u,g,b){return t(),s("div",null,l)}const F=a(i,[["render",h]]);export{m as __pageData,F as default};
